/*
 * The line catalog for O2 is split into two tables: one for coupled lines,
 * and one for uncoupled lines.  These are assigned to the two column types
 * o2_coupled and o2_uncoupled, respectively.  The composite column type o2
 * combines o2_coupled and o2_uncoupled.
 *
 * The coupled lines use line coupling parameters derived from Table 1 in
 *
 *   D. S. Makarov, M. Yu. Tretyakov, and P. W Rosenkranz 2011, "60-GHz
 *   oxygen band: Precise experimental profiles and extended absorption
 *   modeling in a wide temperature range."  JQSRT 112:1420.
 *
 * First-order mixing parameters have been converted from bar^-1 to mbar^-1,
 * and second-order parameters from bar^-2 to mbar^-2.
 *
 * In addition, HITRAN line frequency and pressure broadening data have
 * been replaced with data from Table 1 of
 *
 *   M. Yu. Tretyakov, M. A. Koshelev, V. V. Dorovskikh, D. S. Makarov,
 *   and P. W. Rosenkranz 2005, "60-GHz oxygen band: precise broadening and
 *   central frequencies of fine-structure lines, absolute absorption profile
 *   at atmospheric pressure, and revision of mixing coefficients." J. Mol.
 *   Spec. 231:1.
 *
 * and the air-broadening exponent for the coupled line table has been changed
 * to the value (0.8) assumed by Makarov, et al.  The data in the uncoupled
 * line table are the unmodified HITRAN data.
 *
 * Nonresonant O2 lines from the HITRAN catalog have been replaced by a single
 * 16O2 line, which resides in the coupled line table.  The broadening
 * parameters for this line are adapted from
 *
 *   H. J. Liebe 1985, "An updated model for millimeter wave propagation in
 *    moist air."  Radio Science 20:1069.
 *
 * See also
 *
 *   P. W. Rosenkranz 1982, "Comment on "Absorption and dispersion in the
 *   O2 microwave spectrum at atmospheric pressures"."  J. Chem. Phys.
 *   77:2216.
 *
 * The strength of this single nonresonant line was adjusted to fit the sea
 * level mid-latitude absorption and emission measurements from Table 2 of
 *
 *   L. Danese and R. B. Partridge 1989, "Atmospheric emission models:
 *   confrontation between observational data and predictions in the
 *   2.5-300 GHz frequency range."  Ap. J. 342:604.
 *
 * Since this line represents a sum over all nonresonant transitions, it has
 * been assigned a negative lower-state energy; in linesum.c, this signals
 * that the strength is assumed to be independent of temperature.
 *
 * With the nonresonant line strength thus fixed, the bias applied to the
 * first-order mixing parameters from Makarov, et al., to account for
 * coupling between the non-resonant and resonant absorption, was adjusted
 * by +0.0009 bar^-1 (about 6%).  The adjusted bias value was chosen to
 * give reasonable agreement with the pure oxygen absorption (including
 * O2O2 CIA) measured from 180 GHz to 260 GHz by
 *
 *   A. I. Meshkov and F. C. DeLucia 2007, "Laboratory measurements of dry
 *   air atmospheric absorption with a millimeter wave cavity ringdown
 *   spectrometer."  JQSRT 108:256.
 *
 * This adjustment simultaneously makes the coupled-line absorption
 * coefficient positive over the full atmospheric temperature range.
 *
 * One expects that the nonresonant+coupled absorption should fall to
 * zero in some high-frequency limit.  For example, the adiabatic
 * (constant instantaneous field) assumption underpinning the Debye model
 * will fail when the duration of collision approaches the oscillation
 * period of the field.  However, given the lack of experimental data,
 * no attempt is made in the current version of am to model this.  In any
 * case, the constant Debye absorption will be negligible relative to other
 * sources of absorption in practical applications.
 */

const double o2_Tref = 296.0;

